A303 Highway to the Sun

History Documentary hosted by Tom Fort, published by BBC in 2011 - English narration


Information
------------------------------

The A303 is the road that passes Stonehenge on the way to the beaches of Devon and Cornwall. On the way, it whisks drivers through 5,000 years of remarkable moments in English history. And it is the star of this film made for armchair travellers and history lovers. Writer Tom Fort drives its 92-mile length in a lovingly-restored Morris Traveller. Along the way he has many adventures - he digs up the 1960s master plan for the A303's dreams of superhighway status; meets up with a Neolithic traveller who knew the road like the back of his hand; gets to know a section of the Roman 303; uncovers a medieval murder mystery; and discovers what lies at the end of the Highway to the Sun.

